import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { DatosPService } from './services/datos-pservice.service';
import { AppRoutingModule } from './app-routing.module';
import { HttpClientModule } from '@angular/common/http';
import { AppComponent } from './app.component';
import { DatosPComponent } from './components/datos-p/datos-p.component';
import { FormGroup, FormsModule } from '@angular/forms';
import { HomePageComponent } from './components/home-page/home-page.component';
import { LoginComponent } from './components/login/login.component';
import { RegisterComponent } from './components/register/register.component';
import { ReactiveFormsModule } from '@angular/forms';
import { PaisComponent } from './components/pais/pais.component';
import { PaisService } from './services/pais.service';
import { LugarComponent } from './components/lugar/lugar.component';
import { lugarService } from './services/lugar.service';
import { EstadoComponent } from './components/estado/estado.component';
import { CiudadComponent } from './components/ciudad/ciudad.component';
@NgModule({
  declarations: [
    AppComponent,
    DatosPComponent,
    HomePageComponent,
    LoginComponent,
    RegisterComponent,
    PaisComponent,
    LugarComponent,
    EstadoComponent,
    CiudadComponent
  ],
  imports: [
    BrowserModule,
    HttpClientModule,
    FormsModule,
    ReactiveFormsModule,
    AppRoutingModule
  ],
  providers: [DatosPService,
              PaisService,
            lugarService],
  bootstrap: [AppComponent]
})
export class AppModule { }
